import React from "react";
import NavBar from "../components/common/NavBar";
import Main from "../components/home/Main";
import Footer from "../components/common/Footer";

const Home = () => {
	return (
		<>
			<NavBar />
			<Main />
			<Footer />
		</>
	);
};

export default Home;
